import { Fragment } from "react";


const Editcontact = () =>{
   return(
       <Fragment>
          <form  style={{ margin:"25px 60px 50px 75px"}}>
         <h1 style={{marginTop:"25px"}}>Edit Contact</h1>
         <div>

            <input type="text" name="name"
            placeholder="name" className='form-control my-3'
            style={{borderRadius:"20px 40px",width6}}
            />

            <input type="email" name="email"
            placeholder="email" className='form-control  my-3'
            style={{borderRadius:"20px 40px"}}
            />

             <input type="text" name="contact"
            placeholder="contact" className='form-control  my-3'
            style={{borderRadius:"20px 40px"}}
            />
            <input type="submit" value="send" className="form-control btn btn-primary"
            style={{ marginTop: "20px"}}/>


            </div>


            </form>

       </Fragment>
   );
}
export default Editcontact;
